import Footer from './components/footer/Footer.jsx'
import Header from './components/header/Header.jsx'
import VideoHeader from './components/header/VIdeoHeader.jsx';
import './styles/index.css'
import 'bootstrap/dist/css/bootstrap.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from './pages/About';
import Schedule from './pages/Schedule';
import Office from './pages/Office';
import Donations from './pages/Donations';
import Main from './pages/Main'
import Trebi from './pages/Trebi'
import ControlledCarousel from './components/carousel/ControlledCarousel.jsx';

function App() {


    return (
        <div className='App'>
            <VideoHeader />
            <Header />
            <div className='main-container'>
                <div className='left-container'>

                </div>
                <Router>
                    <Routes>
                        <Route exact path='/' element={<Main />} />
                        <Route exact path='/about' element={<About />} />
                        <Route exact path='/schedule' element={<Schedule />} />
                        <Route exact path='/office' element={<Office />} />
                        <Route exact path='/donations' element={<Donations />} />
                        <Route exact path='/trebi' element={<Trebi />} />
                    </Routes>
                </Router>
                <div className='right-container'>
                    <Col>
                        <Card style={{ width: '300px' }}>
                            <Card.Img />
                            <Card.Body>
                                <Card.Title id={"card_title" + post_num} style={{ height: "141px", overflow: "hidden" }}>
                                    {loadCardTitle(post_num)}
                                </Card.Title>
                                <Button></Button>
                            </Card.Body>

                        </Card>
                    </Col>
                </div>
            </div>
            {/* <ControlledCarousel /> */}
            <Footer />
        </div >
    );
}

export default App;
